import React, { Component } from 'react'
import CardOne from './CardOne';
import CardTwo from './CardTwo';
import CardThree from './CardThree';

export default class Tours extends Component {
    constructor() {
        super()
        this.state = {
            cardone: ['3 day tours','Up to 30 people','2 tour guides','Sleep in cozy hotels','Difficulty: easy'],
            cardtwo: [],
            cardthree: [],
        }
    }
    render() {
        return(<section className='section-tours'>
            <div className='u-center-text u-margin-bottom-large'>
                <h2 className='hdng-sec'>Most popular tours</h2>
            </div>
            <div className='row'>
                <div className='col-1-of-3'><CardOne number='1' heading='The Sea Explorer' price='$297' list={this.state.cardone}/></div>
                <div className='col-1-of-3'><CardTwo/></div>
                <div className='col-1-of-3'><CardThree/></div>
            </div>
            <div className='u-center-text u-margin-top-large'>
                <a href='#btn' className='btn btn--green'>Discover all tours</a>
            </div>
        </section>)
    }
}
